import React from 'react';
import './Content.css';
import Discover from './BrowseTrailer';

function Content (props){
    let movieDiscovered;
    if(props.discovered){
        movieDiscovered=props.discovered.map(discover=>{
            return <Discover
         discover={discover} 
         />

        })
    }
    return(
        <div className="content">
        <div className="title">
        <h3>Discover</h3>
        <h4 >View all + " "+ <i className="fa fa-angle-right"></i></h4>
        </div>
        <div className="discover">
        {movieDiscovered}
        </div>
        <div className="whats-new">
        </div>           

        </div>
    )
}

export default Content;
